Прадаць дом, ці здаць катэдж у арэнду ў вёсцы Семянкі. Набыць дом, ці зняць жыллё ў вёсцы Семянкі на сайце "Дом на Радзіме".
Семянкі - вёска ў Смаргонскім раёне Гродзенскай вобласці Рэспублікі Беларусь. Для гэтага населенага пункта на сайце Radzima.net ёсць наступныя даныя:
- геаграфічныя каардынаты мясцовасці і размяшчэнне вёскі Семянкі на падрабязнай старой мапе пачатку ХХ стагоддзя і сучасных мапах, а таксама на саталітарных здымках Google Maps - Google Мапы;

